import React from 'react';

const Navbar: React.FC = () => {
  return (
    <nav>
      <h1>W807</h1>
      <ul>
        <li>Timezones
            <p>US & EU</p>
        </li>
        <li>Where
            <p>Discord</p>
        </li>
        <li>When
            <p>Every Weekend</p>
        </li>
        <li>Wanna See?
            <p>Galleria</p>
        </li>
      </ul>
    </nav>
  );
}

export default Navbar;
